import React from 'react'

export default function Todo({todo}) {

    const handleClick = (e)=> {
        deleteTodo(todo.id)
    }

    return (
        <div>
            <div><p>{todo.text}</p></div>
            <div onClick={handleClick}><button>x</button></div>
        </div>
    )
}
